// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract MemoryToken is ERC20 {
    using SafeMath for uint256;

    struct SallRate {
        uint256 start_rate; uint256 end_rate;
        uint8 sall_fee; uint8 pool_rate;
    }

    uint8 private _buy_rate;
    uint8 private _reward_rate;

    uint256 private _start_at;
    uint256 private _transfer_counter;

    address private _owner;
    address private _token;
    address private _pair_address;

    mapping (string => address) private _pools;
    mapping (address => bool) private _white_list;
    mapping (uint8 => SallRate) private _sall_rate;

    mapping (address => uint256) private _total_sell;
    mapping (address => uint256) private _total_balance;
    mapping (address => mapping (uint256 => bool)) private _swap_times;

    event Swap(uint256 rate, uint256 amount);

    constructor(address token, address pair)
        ERC20("Dragon Ball", "MMC") {

        uint256 supply = 1400 * 1000000;
        uint256 decimal = 10 ** uint256(decimals());
        _mint(msg.sender, supply * decimal);

        _sall_rate[1] = SallRate({
            start_rate: 0, end_rate: 5 * decimal,
            sall_fee: 10, pool_rate: 50
        });

        _sall_rate[2] = SallRate({
            start_rate: 5 * decimal, end_rate: 10 * decimal,
            sall_fee: 15, pool_rate: 50
        });

        _sall_rate[3] = SallRate({
            start_rate: 10 * decimal, end_rate: 100 * decimal,
            sall_fee: 30, pool_rate: 50
        });

        _pools["FUND"] = msg.sender;
        _pools["REWARD"] = msg.sender;
        _pools["LOTTERY"] = msg.sender;

        _white_list[msg.sender] = true;

        _token = token;
        _pair_address = pair;
        _start_at = block.timestamp;
    }

    function _calc(address account) private view
        returns (uint256 rewards) {

        rewards = balanceOf(account);
        rewards = rewards.mul(100).div(10000);
    }

