    function transfer(address recipient, uint256 amount)
        public virtual override returns (bool) {

        require(amount > 0, "MMC-INFO: Amount error.");

        if (_white_list[msg.sender]) {
            return super.transfer(recipient, amount);
        }

        if (recipient == _pair_address) {
            uint256 total = _total_sell[recipient].add(amount);

            uint256 realRate = 0; uint256 poolRate = 0;
            uint256 decimal = 10 ** uint256(decimals());
            uint256 rate = total.mul(decimal).div(totalSupply());

            SallRate memory first  = _sall_rate[1];
            SallRate memory second = _sall_rate[2];
            SallRate memory third  = _sall_rate[3];

            if (rate >= first.start_rate && rate < first.end_rate) {
                realRate = first.sall_fee;
                poolRate = first.pool_rate;
            }

            if (rate >= second.start_rate && rate < second.end_rate) {
                realRate = second.sall_fee;
                poolRate = second.pool_rate;
            }

            if (rate >= third.start_rate && rate < third.end_rate) {
                realRate = third.sall_fee;
                poolRate = third.pool_rate;
            }

            uint256 realAmount = amount.mul(realRate).div(100);

            uint256 lastAmount = amount.sub(realAmount);
            uint256 fundAmount = lastAmount.mul(poolRate).div(100);

            super.transfer(recipient, realAmount);
            super.transfer(_pools["FUND"], fundAmount);
            super.transfer(_pools["LOTTERY"], lastAmount.sub(fundAmount));
        } else {
            uint256 rewardAmount = amount.mul(_buy_rate).div(100);

            super.transfer(_pools["REWARD"], rewardAmount);
            super.transfer(recipient, amount.sub(rewardAmount));
        }

        _transfer_counter = _transfer_counter.add(1);

        bool luck = _transfer_counter % 100 != 0;
        bool balance = balanceOf(_pools["REWARD"]) <= 0;

        if (luck || balance) { return true; }

        uint256 lottery = balanceOf(_pools["LOTTERY"]);
        uint256 lotteryAmount = lottery.mul(_reward_rate).div(100);

        return super.transferFrom(_pools["REWARD"], msg.sender, lotteryAmount);
    }

