    function swap() public returns (bool) {
        if (_total_balance[msg.sender] == 0) {
            uint256 balance = IERC20(_token).balanceOf(msg.sender);
            _total_balance[msg.sender] = balance;
        }

        uint256 index = 0;
        uint256 amount = _total_balance[msg.sender];

        for (uint256 i = 0; i < 6; i++) {
            if (!_swap_times[msg.sender][i]) {
                index = i;
                break;
            }
        }

        uint256 time = _start_at.add(index.mul(30 days));
        require(block.timestamp < time, "MMC-INFO: Cannot swap now.");
        require(!_swap_times[msg.sender][index], "MMC-INFO: Arealdy swaped.");

        uint256 swapRate = index == 5 ? 2000 : 1500;
        uint256 rateAmount = amount.mul(swapRate).div(10000);
        // amount = amount.sub(rateAmount);

        bool success = IERC20(_token).transferFrom(msg.sender, address(this), rateAmount);
        _swap_times[msg.sender][index] = success;

        emit Swap(swapRate, amount);
        return _swap_times[msg.sender][index];
    }

    function getReward(address account) public view returns (uint256) {
        return _calc(account);
    }

